		"TextFieldComponent.html": "<ext-formpanel\r\n    layout='{\"type\": \"vbox\", \"align\": \"stretch\"}'\r\n    width=\"300\"\r\n    height=\"400\"\r\n    bodyPadding=\"10\"\r\n    shadow=\"true\"\r\n>\r\n    <ext-fieldset\r\n        title=\"Separate Label and Placeholder\"\r\n        margin=\"0 0 20 0\"\r\n    >\r\n        <ext-textfield\r\n            placeholder=\"Enter Name...\"\r\n            label=\"Name\"\r\n            required=\"true\"\r\n        >\r\n        </ext-textfield>\r\n    </ext-fieldset>\r\n    <ext-fieldset\r\n        title=\"Label as Placeholder\"\r\n        margin=\"0 0 20 0\"\r\n    >\r\n        <ext-textfield\r\n            labelAlign=\"placeholder\"\r\n            label=\"Name\"\r\n            required=\"true\"\r\n        >\r\n        </ext-textfield>\r\n    </ext-fieldset>\r\n    <ext-fieldset title=\"With Error Message\">\r\n        <ext-textfield\r\n            labelAlign=\"placeholder\"\r\n            label=\"Label\"\r\n            errorMessage=\"The value you entered is invalid.\"\r\n            value=\"invalid value\"\r\n            errorTarget=\"under\"\r\n        >\r\n        </ext-textfield>\r\n    </ext-fieldset>\r\n</ext-formpanel>;\r\n",
