	"needlegauge": {
		"NeedleGaugeComponent.html": "<ext-formpanel shadow=\"true\" layout=\"vbox\" width=\"850\">\r\n  <ext-sliderfield label=\"Value\" onchange=\"needlegauge.updateGauges\" value=\"30\"></ext-sliderfield>\r\n  <ext-container\r\n    flex=\"1\"\r\n    layout='{ \"type\": \"hbox\", \"align\": \"stretch\"}'\r\n    margin='10 0 10 0'\r\n    minHeight=\"200\"\r\n    width=\"100%\"\r\n  >\r\n    <ext-gauge flex=\"1\" value=\"30\" valueStyle='{\"display\": \"none\" }' onready=\"needlegauge.item1Ready\"></ext-gauge>\r\n    <ext-gauge flex=\"1\" value=\"30\" onready=\"needlegauge.item2Ready\" needle=\"wedge\"></ext-gauge>\r\n  </ext-container>\r\n  <ext-container\r\n    flex=\"1\"\r\n    layout='{ \"type\": \"hbox\", \"align\": \"stretch\"}'\r\n    margin='10 0 10 0'\r\n    minHeight=\"200\"\r\n    width=\"100%\"\r\n  >\r\n    <ext-gauge flex=\"1\" value=\"30\" onready=\"needlegauge.item3Ready\" needle=\"spike\"></ext-gauge>\r\n    <ext-gauge flex=\"1\" value=\"30\" textOffset='{ \"dy\": 45 }' onready=\"needlegauge.item4Ready\"></ext-gauge>\r\n  </ext-container>\r\n</ext-formpanel>\r\n",
		"NeedleGaugeComponent.js": "import './NeedleGaugeComponent.html';\r\nExt.require('Ext.ux.gauge.needle.Diamond');\r\nExt.require('Ext.ux.gauge.needle.Arrow');\r\nExt.require('Ext.ux.gauge.needle.Wedge');\r\nExt.require('Ext.ux.gauge.needle.Spike');\r\n\r\nexport default class NeedleGaugeComponent {\r\n    constructor() {\r\n        this.value = 30;\r\n        this.outerradius = {type: 'diamond', outerRadius:'100%'};\r\n        this.innerradius = {type:'arrow', innerRadius: 0};\r\n    }\r\n\r\n    updateGauges = (event) => {\r\n        if(this.value === event.detail.oldValue[0]){\r\n            this.value = event.detail.newValue;\r\n            this.gauge1Cmp.setValue(this.value);\r\n            this.gauge2Cmp.setValue(this.value);\r\n            this.gauge3Cmp.setValue(this.value);\r\n            this.gauge4Cmp.setValue(this.value);\r\n        }\r\n    }\r\n\r\n    item1Ready = (event) => {\r\n        //console.log(event)\r\n        this.gauge1Cmp = event.detail.cmp;\r\n        this.gauge1Cmp.setNeedle(this.outerradius);\r\n    }\r\n\r\n    item2Ready = (event) => {\r\n        //console.log(event)\r\n        this.gauge2Cmp = event.detail.cmp;\r\n    }\r\n\r\n    item3Ready = (event) => {\r\n        //console.log(event)\r\n        this.gauge3Cmp = event.detail.cmp;\r\n    }\r\n\r\n    item4Ready = (event) => {\r\n        //console.log(event)\r\n        this.gauge4Cmp = event.detail.cmp;\r\n        this.gauge4Cmp.setNeedle(this.innerradius);\r\n    }\r\n}\r\n"
	},
