	"groupedgrid": {
		"GroupedGridComponent.html": "<ext-container layout=\"vbox\" padding=\"10\" height=\"95%\">\r\n  <ext-toolbar margin=\"0 0 20 0\" shadow=\"true\">\r\n    <ext-container key=\"1\" html=\"Grouping:\" style=\"margin-right: '10px'\";>\r\n    </ext-container>\r\n    <ext-segmentedbutton key=\"2\" label=\"Grouping\" >\r\n      <ext-button\r\n        ui=\"toolbar-default\"\r\n        text=\"ON\"\r\n        pressed=\"true\"\r\n        onready=\"groupedgrid.onButtonReady\"\r\n        onTap=\"groupedgrid.onGroupClick\"\r\n      >\r\n      </ext-button>\r\n      <ext-button\r\n        ui=\"toolbar-default\"\r\n        text=\"OFF\"\r\n        onready=\"groupedgrid.offButtonReady\"\r\n        onTap=\"groupedgrid.offGroupClick\"\r\n      >\r\n      </ext-button>\r\n    </ext-segmentedbutton>\r\n  </ext-toolbar>\r\n  <ext-grid\r\n    height=\"95%\"\r\n    width=\"100%\"\r\n    title=\"Restaurants\"\r\n    shadow=\"true\"\r\n    onready=\"groupedgrid.onGridReady\"\r\n    grouped=\"true\"\r\n    groupFooter='{\"xtype\": \"gridsummaryrow\"}'\r\n    stateful=\"true\"\r\n    stateId=\"grouped-grid\"\r\n    plugins='{\r\n      \"gridfilters\": \"true\"\r\n    }'\r\n  >\r\n    <ext-gridcolumn\r\n      text=\"Name\"\r\n      dataIndex=\"name\"\r\n      flex=\"1\"\r\n      groupHeaderTpl=\"{columnName}: {value:htmlEncode}\"\r\n    >\r\n    </ext-gridcolumn>\r\n    <ext-gridcolumn\r\n      text=\"Cuisine\"\r\n      dataIndex=\"cuisine\"\r\n      flex=\"1\"\r\n    >\r\n    </ext-gridcolumn>\r\n    <ext-gridcolumn\r\n      text=\"Rating\"\r\n      dataIndex=\"rating\"\r\n      flex=\"1\"\r\n      summaryCell=\"numbercell\"\r\n      groupHeaderTpl='{value:repeat(\"\")} ({value:plural(\"Star\")})'\r\n      cell='{\r\n        \"xtype\": \"widgetcell\",\r\n        \"widget\": {\r\n          \"xtype\": \"rating\",\r\n          \"tip\": \"Set to {tracking:plural(\\\"Star\\\")}\"\r\n        }\r\n      }'\r\n    >\r\n    </ext-gridcolumn>\r\n  </ext-grid>\r\n</ext-container>\r\n",
		"GroupedGridComponent.js": "import './GroupedGridComponent.html';\r\n\r\nExt.require([\r\n    'Ext.grid.cell.Number',\r\n    'Ext.grid.cell.Widget',\r\n    'Ext.grid.SummaryRow',\r\n    'Ext.ux.rating.Picker',\r\n    'Ext.grid.filters.Plugin'\r\n]); \r\n\r\nexport default class GroupedGridComponent {\r\n    onGridReady = (event) => {\r\n        const store = Ext.create('Ext.data.Store', {\r\n            autoLoad: true,\r\n            proxy: {\r\n                type: 'ajax',\r\n                url: 'resources/data/restaurants.json',\r\n            },\r\n            sorters: ['cuisine', 'name'],\r\n            groupField: 'cuisine'\r\n        });\r\n\r\n        this.gridCmp = event.detail.cmp;\r\n        this.gridCmp.setStore(store);\r\n    }\r\n\r\n    onButtonReady = (event) => {\r\n        this.onButtonCmp = event.detail.cmp;\r\n    }\r\n\r\n    offButtonReady = (event) => {\r\n        this.offButtonCmp = event.detail.cmp;\r\n    }\r\n\r\n    onGroupClick = () => {\r\n        this.gridCmp.setGrouped(true);\r\n        this.onButtonCmp.setPressed(true);\r\n        this.offButtonCmp.setPressed(false);\r\n    }\r\n\r\n    offGroupClick = () => {\r\n        this.gridCmp.setGrouped(false);\r\n        this.offButtonCmp.setPressed(true);\r\n        this.onButtonCmp.setPressed(false);\r\n    }\r\n}\r\n"
	},
