		"TreeGridComponent.html": "<ext-container padding=\"10\" layout=\"fit\" fitToParent=\"true\" height=\"100%\" scrollable=\"true\">\r\n  <ext-tree\r\n    shadow=\"true\"\r\n    onready=\"treegrid.treeReady\"\r\n    columns='[\r\n      {\r\n        \"xtype\":\"treecolumn\",\r\n        \"text\":\"Name\",\r\n        \"dataIndex\":\"text\",\r\n        \"width\":200\r\n      },\r\n      {\r\n        \"xtype\":\"numbercolumn\",\r\n        \"text\":\"# Items\",\r\n        \"dataIndex\":\"numItems\",\r\n        \"width\":100,\r\n        \"format\":\"0,0\"\r\n      }\r\n    ]'\r\n  >\r\n  </ext-tree>\r\n</ext-container>\r\n",
