	"treelist": {
		"data.js": "export default {\r\n    text: 'All',\r\n    children: [{\r\n        text: 'Home',\r\n        iconCls: 'x-fa fa-home',\r\n        children: [{\r\n            text: 'Messages',\r\n            iconCls: 'x-fa fa-inbox',\r\n            leaf: true\r\n        }, {\r\n            text: 'Archive',\r\n            iconCls: 'x-fa fa-database',\r\n            children: [{\r\n                text: 'First',\r\n                iconCls: 'x-fa fa-sliders',\r\n                leaf: true\r\n            }, {\r\n                text: 'No Icon',\r\n                iconCls: null,\r\n                leaf: true\r\n            }]\r\n        }, {\r\n            text: 'Music',\r\n            iconCls: 'x-fa fa-music',\r\n            leaf: true\r\n        }, {\r\n            text: 'Video',\r\n            iconCls: 'x-fa fa-film',\r\n            leaf: true\r\n        }]\r\n    }, {\r\n        text: 'Users',\r\n        iconCls: 'x-fa fa-user',\r\n        children: [{\r\n            text: 'Tagged',\r\n            iconCls: 'x-fa fa-tag',\r\n            leaf: true\r\n        }, {\r\n            text: 'Inactive',\r\n            iconCls: 'x-fa fa-trash',\r\n            leaf: true\r\n        }]\r\n    }, {\r\n        text: 'Groups',\r\n        iconCls: 'x-fa fa-users',\r\n        leaf: true\r\n    }, {\r\n        text: 'Settings',\r\n        iconCls: 'x-fa fa-wrench',\r\n        children: [{\r\n            text: 'Sharing',\r\n            iconCls: 'x-fa fa-share-alt',\r\n            leaf: true\r\n        }, {\r\n            text: 'Notifications',\r\n            iconCls: 'x-fa fa-flag',\r\n            leaf: true\r\n        }, {\r\n            text: 'Network',\r\n            iconCls: 'x-fa fa-signal',\r\n            leaf: true\r\n        }]\r\n    }]\r\n};\r\n",
		"TreeListComponent.html": "<ext-container layout=\"center\" fitToParent=\"false\" flex=\"1\" height=\"100%\">\r\n  <ext-panel\r\n    shadow=\"true\"\r\n    scrollable=\"true\"\r\n    onready=\"treelist.onPanelReady\"\r\n  >\r\n    <ext-toolbar docked=\"top\">\r\n      <ext-segmentedbutton allowMultiple=\"true\">\r\n        <ext-button onready=\"treelist.onButtonReady1\" ui=\"default-toolbar\" text=\"Nav\" onpressedchange=\"treelist.toggleNav\"></ext-button>\r\n        <ext-button onready=\"treelist.onButtonReady2\" ui=\"default-toolbar\" text=\"Micro\" onpressedchange=\"treelist.toggleMicro\"></ext-button>\r\n      </ext-segmentedbutton>\r\n    </ext-toolbar>\r\n    <ext-treelist\r\n      ref=\"tree\"\r\n      width=\"400\"\r\n      onready=\"treelist.onTreeListReady\"\r\n      expanderFirst=\"false\"\r\n      expanderOnly=\"false\"\r\n      micro=\"false\"\r\n      ui=\"nav\"\r\n    >\r\n    </ext-treelist>\r\n  </ext-panel>\r\n</ext-container>\r\n",
		"TreeListComponent.js": "import './TreeListComponent.html';\r\nimport data from './data';\r\n\r\nexport default class TreeListComponent {\r\n    constructor() {\r\n        this.microCmp = false;\r\n        this.ui='nav';\r\n        this.nav=true;\r\n    }\r\n\r\n    onPanelReady = (event) => {\r\n        this.panelCmp = event.detail.cmp;\r\n        const isPhone = Ext.os.is.Phone;\r\n        const top = !isPhone ? '10' : null;\r\n        const left = !isPhone ? '10' : null;\r\n        const width = !isPhone ? '400' : null;\r\n        const height = !isPhone ? '600' : null;\r\n\r\n        this.panelCmp.setTop(top);\r\n        this.panelCmp.setLeft(left);\r\n        this.panelCmp.setWidth(width);\r\n        this.panelCmp.setHeight(height);\r\n    }\r\n\r\n    onTreeListReady = (event) => {\r\n        this.treeCmp = event.detail.cmp;\r\n        this.store = Ext.create('Ext.data.TreeStore', {\r\n            rootVisible: true,\r\n            root: data\r\n        });\r\n        this.treeCmp.setStore(this.store);\r\n    }\r\n\r\n    onButtonReady1 = (event) => {\r\n        this.button1Cmp = event.detail.cmp;\r\n        this.button1Cmp.setPressed(true);\r\n    }\r\n\r\n    onButtonReady2 = (event) => {\r\n        this.button2Cmp = event.detail.cmp;\r\n        this.button2Cmp.setPressed(false);\r\n    }\r\n\r\n    toggleNav = (event) => {\r\n        if (this.treeCmp) {\r\n            this.navCmp = event.detail.value;\r\n            if (this.navCmp) {\r\n                this.treeCmp.setUi('nav');\r\n                this.treeCmp.setExpanderFirst(false);\r\n            } else {\r\n                this.treeCmp.setUi(null);\r\n                this.treeCmp.setExpanderFirst(true);\r\n            }\r\n            this.button2Cmp.setPressed(false);\r\n        }\r\n    }\r\n\r\n    toggleMicro = (event) => {\r\n        this.microCmp = event.detail.value;\r\n        if (this.microCmp) {\r\n            this.treeCmp.setMicro(true);\r\n            this.treeCmp.setExpanderFirst(false);\r\n            this.treeCmp.setUi('nav');\r\n            this.button1Cmp.setDisabled(true);\r\n            this.button2Cmp.setPressed(true);\r\n        } else {\r\n            this.treeCmp.setMicro(false);\r\n            this.treeCmp.setExpanderFirst(false);\r\n            this.treeCmp.setUi('nav');\r\n            this.button1Cmp.setDisabled(false);\r\n            this.button1Cmp.setPressed(true);\r\n            this.button2Cmp.setPressed(false);\r\n        }\r\n    }\r\n}\r\n"
	},
	"treereorder": {
		"TreeReorderComponent.html": "<ext-container padding=\"10\" layout=\"center\" flex=\"1\" height=\"100%\">\r\n  <ext-tree\r\n    onready=\"treereorder.onTreeReady\"\r\n    shadow=\"true\"\r\n    title=\"Files\"\r\n    height=\"400\"\r\n    width=\"350\"\r\n    plugins= '{\r\n      \"treedragdrop\": \"true\"\r\n    }'\r\n  >\r\n    <ext-toolbar docked=\"top\" onready=\"treereorder.toolbarReady\">\r\n      <ext-button text=\"Expand All\" ontap=\"treereorder.onExpandAllClick\"></ext-button>\r\n      <ext-button text=\"Collapse All\" ontap=\"treereorder.onCollapseAllClick\"></ext-button>\r\n      <ext-button text=\"Reset\" ontap=\"treereorder.onResetClick\"></ext-button>\r\n    </ext-toolbar>\r\n  </ext-tree>\r\n</ext-container>\r\n",
		"TreeReorderComponent.js": "import './TreeReorderComponent.html';\r\n\r\nExt.require([ 'Ext.grid.plugin.TreeDragDrop']);\r\n\r\nexport default class TreeReorderComponent {\r\n    onTreeReady = (event) => {\r\n        this.treeCmp = event.detail.cmp;\r\n\r\n        this.treeStore = Ext.create('Ext.data.TreeStore', {\r\n            type: 'tree',\r\n            rootVisible: true,\r\n            sorters: [{\r\n                property: 'text',\r\n                direction: 'ASC'\r\n            }],\r\n            root: {\r\n                text: 'Products',\r\n                expanded: true\r\n            },\r\n            proxy: {\r\n                type: 'ajax',\r\n                url: 'resources/data/tree/cars.json'\r\n            },\r\n        });\r\n        this.treeCmp.setStore(this.treeStore);\r\n    }\r\n\r\n    toolbarReady = (event) => {\r\n        this.toolbar = event.detail.cmp;\r\n    }\r\n\r\n    onExpandAllClick = () => {\r\n        this.treeCmp.mask({\r\n            xtype: 'loadmask',\r\n            message: 'Expanding tree...'\r\n        });\r\n\r\n        this.toolbar.disable();\r\n\r\n        this.treeCmp.expandAll(() => {\r\n            this.treeCmp.unmask();\r\n            this.toolbar.enable();\r\n        });\r\n    }\r\n\r\n    onCollapseAllClick = () => {\r\n        this.toolbar.disable();\r\n\r\n        this.treeCmp.collapseAll(() => {\r\n            this.toolbar.enable();\r\n        });\r\n    }\r\n\r\n    onResetClick = () => {\r\n        this.treeStore.reload();\r\n    }\r\n}\r\n"
	}
